import React, { Component } from "react";
import axios from "axios";

class Content extends Component {
   constructor(props) {
     super(props);
     this.state = {
       dataapi: ""
     };
   }

   getData = async () => {
      const data = await axios.get("https://api.themoviedb.org/3/discover/movie?page=1&api_key=943cc4f77f40afc90157127eac5065c1");
      return data;
   };

   async componentDidMount() {
      let data1 = await this.getData();
      console.log(data1);
   }

   render() {
     const { todos } = this.state;
     return (
       <div>
         <h3>Using componentDidMount for initial data render</h3>
         <hr />
         {todos &&
           todos.map(todo => {
             return (
               <table>
                 <tr>
                   <td>
                     <p key={todo.id}>{todo.title}a</p>
                   </td>
                 </tr>
               </table>
             );
           })}
       </div>
     );
   }
}

export default Content;
